package cn.iinux.java.alpha.bank8583;

import com.imohsenb.ISO8583.builders.ISOMessageBuilder;
import com.imohsenb.ISO8583.entities.ISOMessage;
import com.imohsenb.ISO8583.exceptions.ISOException;

import java.util.Map;
import java.util.Set;

public class Test2 {
    public static void main(String[] args) throws ISOException {
        ISOMessage isoMessage = ISOMessageBuilder.Unpacker()
                .setMessage("")
                .build();
        System.out.println(Test1.bytesToHex(isoMessage.getBody()));
        Set<Map.Entry<Integer, byte[]>> es = isoMessage.getEntrySet();
        System.out.println(es);
    }
}
